import React from 'react';

function EditableName() {
  const handleFocus = (event) => {
    event.textContent = ''; // Clear the text
  };

  return (
    <span
      className="name"
      contentEditable="true"
      id="editableName"
      onFocus={handleFocus}
    >
    </span>
  );
}

export default EditableName;
